import React from 'react';
import Guest from '../../model/Guest';
import './GuestComponent.scss';

interface IGuestComponentsProps {
    guest : Guest;
}

const GuestComponent : React.FC<IGuestComponentsProps> = props => {
    return (
        <div className={`guest ${props.guest.name}`}>
            <h2>{props.guest.name}</h2>
            <p>Flight in : {props.guest.flightIn.flightNumber}</p>
            <p>Flight out : {props.guest.flightOut.flightNumber}</p>
            <p>Room : {props.guest.roomId}</p>
        </div>
    );
}

export default GuestComponent;
